import React from 'react'
import { View, Text } from 'react-native'

const CoinItem = ({ coin }) => { // le pase por parametro el item, del cual tomo solo la propiedad coin

    //Muestro el nombre de la coin
    return (
        <View>
            <Text>{coin.name}</Text>
        </View>
    )
}

export default CoinItem
